CREATE TABLE asset_imports (
	asset_import_id		serial primary key,
	asset_Count		integer,
	Location		varchar(250),
	INVOICE_NO		varchar(250),
	DESCRIPTION		varchar(250),
	Agency			varchar(250),
	Serial_Number		varchar(250),
	Peripherals		varchar(250),
	asset_Value		varchar(250),
	Purchase_date		varchar(250),
	Install_Date		varchar(250),
	Currency		varchar(250),
	Status			varchar(250),
	Type			varchar(250),
	Sheet			integer
);







































